                type: object
                properties:
                  ns4:IdNummer:
                    type: string
                    example: 197910209290
              ns25:PersonsokningSvarspost:
                type: object
                properties:
                  ns4:PersonId:
                    type: object
                    properties:
                      ns4:IdNummer:
                        type: string
                        example: 197910209290
                      ns4:Typ:
                        type: string
                        example: PERSONNUMMER
                  ns5:Sekretessmarkering:
                    type: string
                    example: NEJ
                  ns5:SkyddadFolkbokforing:
                    type: string
                    example: NEJ
                  ns4:SenasteAndringSPAR:
                    type: string
                    format: date
                    example: 2019-12-02
                  ns8:Namn:
                    type: object
                    properties:
                      ns2:DatumFrom:
                        type: string
                        format: date
                        example: 2019-12-02
                      ns2:DatumTill:
                        type: string
                        example: 9999-12-31
                      ns7:Fornamn:
                        type: string
                        example: Rudolf Valentino
                      ns7:Efternamn:
                        type: string
                        example: Efternamn1074
                  ns10:Persondetaljer:
                    type: object
                    properties:
                      ns2:DatumFrom:
                        type: string
                        format: date
                        example: 2019-12-02
                      ns2:DatumTill:
                        type: string
                        example: 9999-12-31
                      ns5:Sekretessmarkering:
                        type: string
                        example: NEJ
                      ns5:SkyddadFolkbokforing:
                        type: string
                        example: NEJ
                      ns10:Fodelsedatum:
                        type: string
                        format: date
                        example: 1979-10-20
                      ns10:Kon:
                        type: string
                        example: MAN
                  ns13:Folkbokforing:
                    type: array
                    items:
                      type: object
                      properties:
                        ns2:DatumFrom:
                          type: string
                          format: date
                          example: 2019-12-02
                        ns2:DatumTill:
                          type: string
                          example: 9999-12-31
                        ns13:FolkbokfordLanKod:
                          type: string
                          example: 01
                        ns13:FolkbokfordKommunKod:
                          type: string
                          example: 82
                        ns13:Hemvist:
                          type: string
                          example: Skriven på adressen
                        ns13:Folkbokforingsdatum:
                          type: string
                          format: date
                          example: 1990-12-01
                        ns13:DistriktKod:
                          type: string
                          example: 212103
                  ns14:Folkbokforingsadress:
                    type: object
                    properties:
                      ns3:SvenskAdress:
                        type: object
                        properties:
                          ns2:DatumFrom:
                            type: string
                            format: date
                            example: 2019-12-02
                          ns2:DatumTill:
                            type: string
                            example: 9999-12-31
                          ns3:Utdelningsadress2:
                            type: string
                            example: Gatan101 2
                          ns3:PostNr:
                            type: string
                            example: 13336
                          ns3:Postort:
                            type: string
                            example: SALTSJÖBADEN
              ns25:UUID:
                type: string
                example: 4c01c98d-dc0c-400b-ab17-3a76eb5b6e49
